// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "./access/Ownable.sol";
import "./token/ERC20/ERC20.sol";
import "./token/ERC721/ERC721.sol";
import "./DonateNFT.sol";

struct Sales {
    address seller;
    // uint256 tokenId;
    uint256 price;
}

contract Market is Ownable {
    address public admin;
    address public NFTAddress;
    address public saleListAddress;

    constructor(address _NFTAddress, address _saleListAddress) {
        admin = msg.sender;
        NFTAddress = _NFTAddress;
        saleListAddress = _saleListAddress;
    }

    function newSale(
        address seller,
        uint256 itemId,
        uint256 price
    ) public returns (address) {
        SaleList(saleListAddress).newSale(seller, itemId, price);
    }

    function allSales() public view returns (Sales[] memory) {
        return SaleList(saleListAddress).allSales();
    }

    function trading(address buyer, uint256 itemId) public returns (uint256) {
        address seller = SaleList(saleListAddress).getSeller(itemId);

        DonateNFT(NFTAddress).transferFrom(seller, buyer, itemId);
    }
}

contract SaleList {
    Sales[] public sales;

    IERC20 public erc20Contract;
    IERC721 public erc721Constract;

    constructor() {}

    function newSale(
        address seller,
        uint256 itemId,
        uint256 price
    ) public returns (uint256) {
        sales[itemId] = Sales(seller, price);
        // sales.push(Sales(seller, itemId, price));
    }

    function getSeller(uint256 tokenId) public view returns (address) {
        return sales[tokenId].seller;
    }

    // function purchase() public {
    //     // TODO
    // }

    // function getSaleInfo()
    //     public
    //     view
    //     returns (
    //         uint256,
    //         uint256,
    //         address,
    //         address
    //     )
    // {
    //     return (price, tokenId, currencyAddress, nftAddress);
    // }

    function allSales() public view returns (Sales[] memory) {
        return sales;
    }

    function _getCurrencyAmount() private view returns (uint256) {
        return erc20Contract.balanceOf(msg.sender);
    }

    // modifier를 사용하여 함수 동작 조건을 재사용하는 것을 권장합니다.
    // modifier onlySeller() {
    //     require(msg.sender == seller, "Sale: You are not seller.");
    //     _;
    // }
}
